ether\\\" with Cieszyn implements numerous projects aimed at activating the unemployed and those threatened with social exclusion through work and education. By creating new jobs in the social enterprise we run, we support the return to society of people at risk of marginalization.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:08:12\"\n    }\n}','','','trash','closed','closed','','90dde194-4366-4d92-88bb-7443003fc914','','','2018-10-28 22:08:12','2018-10-28 22:08:12','',0,'http://localhost/testsite/?p=76',0,'customize_changeset','',0),(77,1,'2018-10-28 22:14:38','2018-10-28 22:14:38','{\n    \"zerif-lite::zerif_aboutus_feature1_title\": {\n        \"value\": \"our impact \",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:12:00\"\n    },\n    \"zerif-lite::zerif_aboutus_feature1_text\": {\n        \"value\": \"Opening minds, changing lives.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:13:00\"\n    },\n    \"zerif-lite::zerif_aboutus_feature1_nr\": {\n        \"value\": \"88\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:12:00\"\n    },\n    \"zerif-lite::zerif_aboutus_feature2_title\": {\n        \"value\": \"passion inside of us\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:13:00\"\n    },\n    \"zerif-lite::zerif_aboutus_feature2_text\": {\n        \"value\": \"Hope in Motion\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:13:00\"\n    },\n    \"zerif-lite::zerif_aboutus_feature3_title\": {\n        \"value\": \"our Services\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2018-10-28 22:14:00\"\n    },\n    \"zerif-lite::zerif_aboutus_feature3_text